  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Volume of Home- and Community-Based Services
  and Time to Nursing-Home Placement<br />nThe purpose of this study was to determine
  whether the volume of Home and Community Based Services (HCBS) that target Activities
  of Daily Living disabilities, such as attendant care, homemaking services, and home-delivered
  meals, increases recipients risk of transitioning from long-term care provided through
  HCBS to long-term care provided in a nursing home.</p>n\",\n\t\"license_title\":
